import React from 'react';
import '../styles/app.css'

function Header(){
    return(
        <header className = 'header'> 
            <li> Home </li>
            <li> About Me </li>
            <li> Portfolio </li>
            <li> Resume </li>
            <li> Contact Me</li>
        </header>

    );
} 

export default Header;
